import styled from "styled-components";

function App() {

  let numArr = [];
  for(let i = 0; i<10; i++){
    numArr[i] = i+1;
  }

  return (
    <div className="App">
      <h1>Tic Tac Toe</h1>
      <Container>
        <tr>
          <Td>numArr[0]</Td>
          <Td>numArr[1]</Td>
          <Td>numArr[2]</Td>
        </tr>
        <tr>
          <Td>numArr[3]</Td>
          <Td>numArr[4]</Td>
          <Td>numArr[5]</Td>
        </tr>
        <tr>
          <Td>numArr[6]</Td>
          <Td>numArr[7]</Td>
          <Td>numArr[8]</Td>
        </tr>
      </Container>
    </div>
  );
}

const Container = styled.table`
  width: 100px;
  height: 100px;
`;

const Td = styled.td`
  border: 1px solid #000000;
  text-align: center;
`;

export default App;
